def calculate_frequencies(file_contents):
    # Here is a list of punctuations and uninteresting words you can use to process your text
    punctuations = '''!()-[]{};:'"\,<>./?@#$%^&*_~'''
    uninteresting_words = ["the", "a", "to", "if", "is", "it", "of", "and", "or", "an", "as", "i", "me", "my", \
                           "we", "our", "ours", "you", "your", "yours", "he", "she", "him", "his", "for", "not", "in", "also", "through", \
                           "her", "hers", "one", "may", "other", "later", "its", "they", "them", "only", "on", "most", "must", "these", \
                           "same", "itself", "than", "between", "than", "into", "many", "become", "even", "first", "there", "new", \
                           "their", "what", "which", "who", "whom", "this", "that", "am", "are", "was", "were", "be", "been", "being", \
                           "have", "has", "had", "do", "does", "did", "but", "at", "by", "with", "from", "here", "when", "where", "how", \
                           "all", "any", "both", "each", "few", "more", "some", "such", "no", "nor", "too", "very", "can", "will", "just"]

    # LEARNER CODE START HERE
    frequency = {}
    file_contents = file_contents.lower()
    words = file_contents.split()


    for word in words:
        if word not in uninteresting_words:
            if word.isalpha():
                if word not in frequency:
                    frequency[word] = 1
                else:
                    frequency[word] += 1

    #wordcloud
    cloud = wordcloud.WordCloud()
    cloud.generate_from_frequencies(frequency)
    return cloud.to_array()
